$("#submit-id").on("click",function(){var t={username:$("#id_username").val().trim(),password:$("#id_password").val().trim()};$.ajax({type:"post",url:"http://tk.jetcloudtech.com/backendLogin/",xhrFields:{withCredentials:!0},crossDomain:!0,data:t,success:function(t,s,e){"string"==typeof t&&(t=JSON.parse(t)),t.is_active&&t.is_staff?(sessionStorage.setItem("pk",t.pk),window.location.href="index.html"):t.status?alert(t.status):alert("登录失败,请重试!")},error:function(t){alert("登录失败,请重试!")}})}),$("#id_password").on("keypress",function(t){"13"==t.keyCode&&$("#submit-id").trigger("click")});